import React from "react";
import { Card, Figure } from "react-bootstrap";
import pin from "../../assets/icons/pin.svg";
import open from "../../assets/icons/openOrange.svg";
import credit from "../../assets/icons/creditCardPayment.svg";
import cash from "../../assets/icons/cash.svg";
import "./styles.scss";

const HomeCard = () => {
  return (
    <div className="container-fluid" className="outline_card">
      <div className="row" className="card">
        <div className="container" className="card_margin">
          <div className="row">
            <div className="col-4">
              <Card
                style={{
                  width: "18rem",
                  display: "flex",
                  flexDirection: "row",
                }}
              >
                <Card.Img
                  variant="top"
                  src="https://cdn.pixabay.com/photo/2016/12/26/17/28/spaghetti-1932466_960_720.jpg"
                />
                <Card.Body>
                  <Card.Title>Card Title</Card.Title>
                  <Card.Text>
                    Some quick example text to build on the card title and make
                    up the bulk of the card's content.
                  </Card.Text>
                </Card.Body>
              </Card>

              <Card.Img variant="top" className="image figure" alt="image" />
            </div>
            <div className="col-8">
              <h4 className="name">Fonda Don Jose</h4>
              <p className="metros">
                a 300 m<img src={pin}></img>
              </p>

              <div>
                <img src={open}></img>
                <div>
                  <img src={credit} className="icon-money"></img>
                  <img src={cash} className="icon-money"></img>
                </div>
              </div>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};
export default HomeCard;
